import React from 'react';
import './style_login.css';

import Background from './backgroundLogin';
import Form from './loginForm';
import Join from './joinButton';
function login(){
    return(
        <div className="mainDiv">
            <Background />
            <div>
                <Form />
                <Join />
            </div>
        </div>
    );
}

export default login;
